syntax = "proto3";

package make87_messages_ros2.humble.ublox_msgs.msg;

import "make87_messages/core/header.proto";

message EsfINS {
    make87_messages.core.Header header = 1;
     uint32 bitfield0 = 2;
    repeated uint32 reserved1 = 3;
     uint32 i_tow = 4;
     int32 x_ang_rate = 5;
     int32 y_ang_rate = 6;
     int32 z_ang_rate = 7;
     int32 x_accel = 8;
     int32 y_accel = 9;
     int32 z_accel = 10;
}
